function getPlayerGameLogAJAX(n,t,i){return this.PlayerID=n,this.Season=t,this.SeasonType=i,this.queryString="?PlayerID="+n+"&Season="+t+"&SeasonType="+i,this.apiURL="http://stats.nba.com/stats/playergamelog/"+this.queryString,$.ajax({url:this.apiURL,success:function(n){return console.log("Player Game log AJAX Request successfully transmitted."),n},error:function(n,t,i){return console.log("Status: "+t),alert("Error: "+i),null}})}function getObjectFromAJAX(n){return JSON.parse(n.responseText)}function postJSONStringToServerAJAX(n,t){$.ajax({url:n,type:"POST",contentType:"application/json; charset=utf-8",data:t,error:function(n){alert(n.responseText)},success:function(n){alert(n)}})}$("#updateStats").click(function(){var n=getPlayerGameLogAJAX("201566","2016-17","Regular Season").done(function(t){var i=JSON.stringify([n]);return postJSONStringToServerAJAX("/PlayerProfiles/UpdateAverages",i),console.log(i),t})});